    doWork = function(answers){
        var items = $('body').html().match(/(>| )(\d{1,2})、(.*?)<br>/ig);
        for(i = 0; i < 20; ++i){
            var qs = items[i].match(/(>| )(\d{1,2})、(.*?)<br>/i);
            var cks = {'A': 0, 'B': 1, 'C': 2, 'D': 3};

            for(var j = 0; j < answers.length; ++j){
                var ass = answers[j].split('\n');
                var as = ass[1].match(/正确答案:([A-D]{1,4})/i);
                var as_x = as[1].split('')
                if($.trim(qs[3]).replace(/\s+/g,"") == $.trim(ass[0]).replace(/\s+/g,"")){
                    if(i < 10){
                        var as_str = $.trim(ass[2 + cks[as_x[0]]].replace(/[A-D]. /i, ''))
                        for(var k = 0; k < 4; ++k){
                            var obj = $('#cbk'+ (i+1) +'_'+ k);
                            var obj_lab = obj.next();
                            var s = $.trim(obj_lab.text().replace(/[A-D]. /i, ''));

                            var flag = 0;
                            if(s.replace(/\s+/g,"") == as_str.replace(/\s+/g,"")){
                                obj.attr('checked', 'true');
                                obj_lab.attr('title', answers[j]);
                                obj_lab.css('background-color', '#ff0');
                                ++flag;
                                break;
                            }
                        }
                    }else{
                        for(var k = 0; k < 4; ++k){
                            var as_str = $.trim(ass[2 + k].replace(/[A-D]. /i, ''))
                            var obj = $('#cbl'+ (i+1) +'_'+ k);
                            var obj_lab = obj.next();
                            var s = $.trim(obj_lab.text().replace(/[A-D]. /i, ''));

                            var flag = 4;
                            if(s.replace(/\s+/g,"") != as_str.replace(/\s+/g,"")){
                                flag = 0;
                                break;
                            }
                        }

                        if(flag > 0){
                            for(var x = 0; x < as_x.length; ++x){
                                obj = $('#cbl'+ (i+1) +'_'+ cks[as_x[x]]);
                                obj_lab = obj.next();
                                obj.attr('checked', 'true');
                                obj_lab.attr('title', answers[j]);
                                obj_lab.css('background-color', '#ff0');
                            }

                            break;
                        }
                    }

                    if(flag > 0){
                        break;
                    }
                }
            }
        }
    }
